import React, {Component} from 'react';
import Header from './Header';
import Jumbotron from './Jumbotron';
import Review from './Review';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
      <Header />
      <Jumbotron />
      <Review title='Hello WatchKit' body='Last month Apple released the anticipate WatchKit Framework for developers in the form of iOS 8.2 beta SDK release. The WatchKit framework enable the developers to create Apple Watch applications. In this article we are going to focus on the basics of getting started with the WatchKit framework and developing apps for the Apple Watch.' comments='12' likes='124' />
      </div>
    )
  }
}

export default App;
